import React from 'react';
import styled from 'styled-components';

import './Slider.css';


const Container=styled.div`
display:flex;
flex:1;
aling-items:center;
justify-content:center;
height:100vh;
width:100%;
position:absolute;
`;

const Dummy = () => {
  return (
      <Container>
<body>
  <div class="slider">
    <ul>
      <li><img src="https://i.ytimg.com/vi/5AwUdTIbA8I/maxresdefault.jpg" alt="" /></li>
      <li><img src="https://i.ytimg.com/vi/smHxeRdf7oI/maxresdefault.jpg" alt="" /></li>
      <li><img src="https://i.kinja-img.com/gawker-media/image/upload/s--mYcKgN6---/epknhm6tldidn1tbltpi.jpg" alt="" /></li>
      <li><img src="http://cde.laprensa.e3.pe/ima/0/0/1/4/1/141172.jpg" alt="" /></li>
    </ul>
  </div>
</body>

</Container>
  );
}

export default Dummy;
